import React from "react";

export default function Card(props) {
    return (
        <>
     <div className='box btn_shadow'>
          <img src={props.image} alt='' />
          <h2>{props.title}</h2>
          <p>{props.desc}</p>
          <a href="http://wwwgoogle.com">
            <i className='fas fa-arrow-right'></i>
         </a>
        
      </div>
    </>
    )
}
